class Footer extends Component{
    render(){
        return(
        <>
        <hr/>
        <center>
        <h3>Contact</h3>
        <b>Mob:</b>
        <p>789456730</p>
        <b>Email:</b>
        <p>123@gmail.com</p>
        </center>
        </>
        );
    }
}
export default Footer;
